export class Page {
  timeout = 3000;

  getUrl() {
    return browser.getUrl();
  }

  selectAndGetElement(selector, timeout = this.timeout) {
    const element = $(selector);
    element.waitForDisplayed(timeout);
    return element;
  }

  getElementAndScrollIntoView(selector, timeout = this.timeout) {
    const element = $(selector);
    element.scrollIntoView();
    element.waitForDisplayed(timeout);
    return element;
  }

  clickElement(selector, timeout = this.timeout) {
    const element = this.selectAndGetElement(selector);
    element.waitForClickable({timeout});
    element.click();
  }

  waitForOverlay() {
    this.selectAndGetElement('.fullscreen-overlay--enter-done');
  }

  switchToNewOpenedWindow() {
    const existingWindowIds = browser.getWindowHandles();

    browser.switchToWindow(existingWindowIds[existingWindowIds.length - 1]);

    browser.pause(2000);

    browser.saveScreenshot('./_results_/test.png');
  }
}

