import {Page} from '../Page';

class VacancyClass extends Page {
  currentHotelListItemPosition = 1;
  offer = {};

  chooseAHotel() {
    const hotel = this.selectAndGetElement(
      this.currentHotelListItemPosition === 1
        ? '.hotel-list .hotel-list__item:first-of-type [data-cy="hotel-tile"] [data-cy="hotel-tile-info"]'
        : `.hotel-list .hotel-list__item:nth-of-type(${this.currentHotelListItemPosition}) [data-cy="hotel-tile"] [data-cy="hotel-tile-info"]`
    );
    hotel.click();
    this.selectAndGetElement('.hotel-details__nav-bar');
  }

  preloadHotelTile() {
    this.getElementAndScrollIntoView(
      this.currentHotelListItemPosition === 1
        ? '.hotel-list .hotel-list__item:first-of-type [data-cy="hotel-tile"]'
        : `.hotel-list .hotel-list__item:nth-of-type(${this.currentHotelListItemPosition}) [data-cy="hotel-tile"]`
    );
  }

  vacancyCheck() {
    this.currentHotelListItemPosition = 1;

    for (let hI = 1; hI < 4; hI++) {
      const haveMinOneVacancyAtOffersList = this.checkVacancyStackOfHotel();
      if (haveMinOneVacancyAtOffersList) {
        console.log(this.offer, '##########');
        break;
      }

      this.navigateBackAndChooseNextHotel();

      if (hI === 3 && !haveMinOneVacancyAtOffersList) {
        assert.fail('no bookable vacancies found at the first three hotels');
      }
    }
  }

  navigateBackAndChooseNextHotel() {
    browser.back();
    this.currentHotelListItemPosition++;
    this.preloadHotelTile();
    this.chooseAHotel();
  }

  checkVacancyStackOfHotel() {
    for (let i = 1; i < 7; i++) {
      const hasSuccessVacancy = this.checkSingleVacancy(i);
      if (hasSuccessVacancy) {
        return true;
      }

      if (i === 6 && !hasSuccessVacancy) {
        return false;
      }
    }
  }

  checkSingleVacancy(childNumber) {
    const tile = this.selectAndGetElement(
      childNumber === 1
        ? `.offers__list .offer-tile:first-of-type`
        : `.offers__list .offer-tile:nth-of-type(${childNumber})`
    );
    const availabilityButton = tile.$(
      '[data-cy="offer-tile-check-availability"]'
    );
    availabilityButton.waitForClickable({timeout: this.timeout});
    availabilityButton.click();

    try {
      const bookingButton = tile.$('[data-cy="offer-tile-to-booking"]');
      bookingButton.waitForDisplayed(5000);
    } catch (e) {
      return false;
    }

    this.storeTravelData(tile);

    return true;
  }

  storeTravelData(element) {
    this.offer.price = element.$('.offer-tile__price-value--success').getText();
    this.offer.departure = element
      .$('[data-cy="offer-tile-outbound-flight"] > strong')
      .getText();
    this.offer.hotelName = $('[data-cy="hotel-details-name"]').getText();
  }

  clickBookingButton() {
    this.storeTravelData();
    const bookingButton = this.selectAndGetElement(
      '[data-cy="offer-tile-to-booking"]',
      200
    );

    bookingButton.click();

    browser.pause(2000);
    this.switchToNewOpenedWindow();
    compareTravelData();
  }
}

export const Vacancy = new VacancyClass();

