import {Then} from 'cucumber';
import assert from 'assert';

import {Find} from '../pages/Find';
import {Map} from '../pages/Map';
import {Filter} from '../pages/Filter';
import {Vacancy} from '../pages/offers/Vacancy';
import {Store} from '../store/Store';
import {Booking} from '../pages/Booking';
import {Page} from '../pages/Page';

// MAP

Then(/^I am at '(.*)'$/, url => {
  assert.strictEqual(url, browser.getUrl());
});

Then(/^I go to hotel list with params:$/, dataTable => {
  const rawData = dataTable.raw();
  const query = Find.getQueryForParams(rawData);
  Find.goTo(query);
});

Then(/^I go to the map$/, () => {
  if (!Find.checkForNecessaryQueryParams()) {
    assert.fail(
      'necessary query params missing, do you use the "I go to find with params:" step before?'
    );
  }

  Find.goToMap();
  Map.waitForInitMap();
});

Then('I select the a hotel marker', () => {
  Map.selectHotelMarker();
});

Then('I click the hotel tile', () => {
  Map.clickHotelTile();
});

Then('I click the back navigation button', () => {
  Map.clickBacknavigation();
  Map.waitForInitMap();
});

Then('I filter for:', dataTable => {
  Filter.setIsOnOverlay(true);
  Filter.openFilter();

  const rawData = dataTable.raw();
  Filter.selectFilter(rawData);
  Filter.submitFilters();
});

Then('I close the map', () => {
  Map.closeMap();
});

// Vacancy

Then('I choose the first hotel', () => {
  Vacancy.chooseAHotel();
});

Then(
  'I check for a valid vacancy for this hotel or check the next hotels',
  () => {
    Vacancy.vacancyCheck();
  }
);

Then('I click the Booking button', () => {
  Vacancy.clickBookingButton();
  Booking.compareTravelDataFromVacancy();
});

// Booking

Then('I open and close the travel summary', () => {
  Booking.openTravelInformation();
  Booking.closeTravelInformation();
});

Then('I set costumer gender to female', () => {
  Booking.clickFemaleGender();
});

Then('I fill the Costumer data field with params:', dataTable => {
  const rawData = dataTable.raw();
  Booking.fillCostumerDataForm(rawData);
});

Then('I click the button for taking lastname for all traveller', () => {
  Booking.clickSameLastname();
});

Then('I fill the form for all other traveller', () => {
  Booking.fillAllTravellerInformation();
});

Then('I select no insurance', () => {
  Booking.setNoInsurance();
});

Then('I enter my Kundenwunsch', () => {
  Booking.setKundenwunsch();
});

Then(/^I enter my vouchercode '(.*)'$/, voucher => {
  Booking.setVoucherCode(voucher);
});

Then('I make choice for payment', () => {
  Booking.setPayment();
});

Then('I click the Pay button', () => {
  Booking.clickTheBookingButton();
});

