import {Page} from './Page';

class FilterClass extends Page {
  filterSelectorList = {
    category: value => `.category-select > [data-value="${value}"]`,
    rating: value => `.rating-select__rating[data-value="${value}"]`,
    topFilter: value => `[data-cy="filter-attribute-${value}"]`,
    roomType: value => `[data-cy="filter-attribute-${value}"]`,
  };

  clickBeforeFilterSelectList = {
    roomType: '.room-types-select__show-all',
  };

  isOnOverlay = false;

  setIsOnOverlay(overlay) {
    this.isOnOverlay = overlay;
  }

  openFilter() {
    this.clickElement(
      this.isOnOverlay
        ? '.fullscreen-overlay .filters__add-filter'
        : '.filters__add-filter'
    );
    this.waitForOverlay();
  }

  selectFilter(data) {
    data.map(filter => {
      const filterKey = filter[0];
      const filterValue = filter[1];
      const beforeClickSelector = this.clickBeforeFilterSelectList[filterKey];
      if (beforeClickSelector) {
        this.clickElement(
          this.isOnOverlay
            ? `.fullscreen-overlay ${beforeClickSelector}`
            : beforeClickSelector
        );
      }

      const selector = this.filterSelectorList[filterKey];
      if (selector) {
        const split = filterValue.split(',');

        if (split.length === 1) {
          this.clickElement(
            this.isOnOverlay
              ? `.fullscreen-overlay ${selector(filterValue)}`
              : selector(filterValue)
          );
          return;
        }

        split.map(val => {
          this.clickElement(
            this.isOnOverlay
              ? `.fullscreen-overlay ${selector(val)}`
              : selector(val)
          );
        });

        return;
      }

      assert.fail(`The FilterKey: ${filterKey} is not defined`);
    });
  }

  submitFilters() {
    this.clickElement(
      this.isOnOverlay
        ? '.fullscreen-overlay [data-cy="filter-submit"]'
        : '[data-cy="filter-submit"]'
    );
  }
}

export const Filter = new FilterClass();

