// @flow

type StoreType = {
  offer: OfferStore,
  search: SearchStore,
};

type OfferStore = {
  price: string,
  departure: string,
  hotelName: string,
  url: string,
};

type SearchStore = {
  children: number[],
  adults: number,
};

class StoreClass {
  store = {
    offer: {},
    search: {},
  };

  getStore(): StoreType {
    return this.store;
  }

  setStore(store: StoreType) {
    this.store = store;
  }

  getOfferStore(): OfferStore {
    return this.store.offer;
  }

  setOfferStore(offer: OfferStore) {
    this.store.offer = offer;
  }

  getSearchStore(): SearchStore {
    return this.store.search;
  }

  setSearchStore(search: SearchStore) {
    this.store.search = search;
  }
}

export const Store = new StoreClass();

