    //     `.travellerEntry__person`
    //   ).;
    // console.log(countOfTraveller, '#####w#####################w######');
    this.setTravellerInformation(i);
    this.setTravellerBirthdate(i);
  }

  setGender(i) {
    this.clickElement(
      $(
        '.react-inputs-validation__option-list-item_identifier [for="react-inputs-validation__radiobox_option-MRS_' +
          i +
          '"]'
      )
    );
  }

  setTravellerBirthdate(i) {
    const search = Store.getSearchStore();
    let birthdateSelector = this.selectAndGetElement(
      '#traveler-' + [i] + '-birthday'
    );
    if (i <= search.adults - 1) {
      birthdateSelector.setValue('09.03.1983');
    } else {
      let childCount = 0;
      let date = moment(new Date());
      let childage = search.children[childCount] * 366;
      let childBirthday = date.subtract(childage, 'days').format('DD.MM.YYYY');
      birthdateSelector.setValue(childBirthday);
    }
  }

  setTravellerInformation(i) {
    let firstname = $(`#firstName-traveller` + [i]);
    if (firstname.isExisting()) {
      const firstnameSelector = this.selectAndGetElement(firstname);
      firstnameSelector.setValue('traveltainment');
      this.setTravellerBirthdate(i);
      this.setGender(i);
      i++;
      firstname = $(`#firstName-traveller` + [i]);
      this.setTravellerInformation(i, firstname);
    }
  }

  setNoInsurance() {
    const noInsurance = this.selectAndGetElement(
      '.insurance--option-no .radioButton-indicator'
    );
    this.clickElement(noInsurance);
  }

  setKundenwunsch() {
    const kundenwunsch = this.selectAndGetElement(
      '.customer-notice [type="text"]'
    );
    kundenwunsch.setValue('automatisierte Testbuchung');
  }

  setVoucherCode(voucher) {
    const voucherInput = this.selectAndGetElement('.voucher__input input');
    voucherInput.setValue(voucher);
    this.clickElement('.voucher__button');
  }

  setPayment() {
    $('.payment__info--dataProtection').scrollIntoView();
    console.log(this.getUrl(), '###################################');
    if (!$('.payment--option-invoice .radioButton-indicator').isExisting()) {
      this.clickElement('.payment--option-cc .radioButton-indicator');
      // $('input#creditcard-select').click();
      // $('.creditcard-name__options li[0]').click();
      $('.payment-iframe').scrollIntoView();
      browser.pause(500);
      const iframeLocator = $('#iframe-ccpay');
      browser.switchToFrame(iframeLocator);
      console.log('start iframe ######################');
      $('#cardNumber').setValue('4111111111111111');
      $('#cardHolderFirstName').setValue('traveltainment');
      $('#cardHolderLastName').setValue('traveltainment');

      const selectCcMonth = $('#cardExpDateMonth');
      selectCcMonth.selectByAttribute('value', '12');
      const selectCcYear = $('#cardExpDateYear');
      const year = moment()
        .add(2, 'year')
        .format('YY');
      selectCcYear.selectByAttribute('value', year);

      const cardCvc = this.selectAndGetElement('#cardCvc');
      cardCvc.setValue('123');

      browser.switchToFrame(null);
      console.log('close iframe -------------');
      this.setKundenwunsch();

      const priceOverview = $(
        '.heading.heading--type-h4.priceoverview__heading'
      );

      priceOverview.scrollIntoView();
      browser.pause(2000);
      return;
    }
    this.clickElement('.payment--option-invoice .radioButton-indicator');
  }

  clickTheBookingButton() {
    this.clickElement('.confirm-booking .confirm-booking__button');
  }
}

export const Booking = new BookingClass();

